  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Swan Lake National
  Refuge covers refuge activities during February 1941 - December 1942. Weather and
  water conditions are summarized. Next wildlife are covered waterfowl, upland game
  birds, predator and rodent control, furbearers and other records. Refuge development
  and maintenance covers construction and plantings. Next, public relations covers
  visitors and law enforcement. Economic uses of the refuge include timber removal,
  grazing, and cooperative farming. Other items, NR forms and photographs are included.\",\n\t\"owner_org\":
